INSERT INTO `bases_de_datos` (`id`, `nombre`, `descripcion`, `created_by`, `modified_by`, `created`, `modified`, `deleted`) VALUES
(1, 'ELCD 3.2', 'European reference Life Cycle Database, desarrollada por Joint Research Center (2015). Contiene los factores de caracterización para distintos materiales y actividades de construcción, para múltiples metodologías de cálculo', 1, NULL, '2018-01-01 00:00:00', NULL, 0),
(2, 'Elaboración propia', 'Para el caso de los elementos no disponibles en las bases de datos especializadas en Análisis de Ciclo de Vida, a las que se tiene acceso, se construyeron los factores de caracterización a partir de fuentes bibliográficas manteniendo la metodologías correspondientes.', 1, 1, '2018-11-23 14:09:58', '2018-11-23 14:16:18', 0),
(3, 'IPCC 2006', '2006 IPCC Guidelines for National Greenhouse Gas Inventories. Estas directrices se basan en su versión resisada de 2006,  con nuevas pautas para el uso global que cubren nuevas fuentes y gases, así como actualizaciones de métodos publicados anteriormente  ampliamente aplicables, donde el conocimiento técnico y científco ha mejorado.', 1, NULL, '2020-06-01 00:48:18', NULL, 0),
(4, 'IPCC Measured', 'Las posibles fuentes de datos incluyen las mediciones sobre el terreno, las observaciones, la teledetección y las entrevistas. El proceso de notificación oficial de los resultados de las evaluaciones se realiza a la CMNUCC, de conformidad con formatos predeterminados y normas establecidas, en particular, de las directrices y la orientación sobre las buenas prácticas del Grupo Intergubernamental de Expertos sobre el Cambio Climático (IPCC) ', 1, NULL, '2020-06-01 00:00:00', NULL, 0),
(5, 'HuellaChile 2017', 'Base de datos generada por el programa HuellaChile, para la cuantificación de huella de carbono de distintas organizaciones públicas y privadas, del Ministerio de Medio Ambiente de Chile y el apoyo del PUND para alcanzar las NDC del país. ', 1, NULL, '2020-06-01 00:00:00', NULL, 0),
(6, 'HuellaChile 2019', '', 1, NULL, '2023-09-13 16:00:45', NULL, 0),
(7, 'Energía Abierta', '', 1, NULL, '2023-09-13 16:14:02', NULL, 0),
(8, 'DEFRA  2022', '', 42, NULL, '2023-09-14 13:03:03', NULL, 0),
(9, 'DEFRA 2023', 'https://www.gov.uk/government/publications/greenhouse-gas-reporting-conversion-factors-2023 ', 2, NULL, '2024-05-30 18:10:01', NULL, 0),
(10, 'CENACE 2023', 'Electricidad Ecuador', 2, NULL, '2024-06-13 16:23:34', NULL, 0);
